import React from 'react';

const Codewriter = ({content}) => {

    const pushHandler = (singleLine_content) => {
        if(singleLine_content.includes("constant")){
            return console.log("THis is the Push Constant Handler",singleLine_content);
        }
        else if(singleLine_content.includes("pointer")){
            return console.log("This is the Push Pointer Handler",singleLine_content);
        }
        else if(singleLine_content.includes("static")){
            return console.log("This is the Push Static Handler",singleLine_content)
        }
        else{
            return console.log("This is the Push Rest of the Members",singleLine_content)
        }
    }
    const popHandler = (singleLine_content) => {
        if(singleLine_content.includes("constant")){
            return console.log("THis is the Constant Handler",singleLine_content);
        }
        else if(singleLine_content.includes("pointer")){
            return console.log("This is the Pointer Handler",singleLine_content);
        }
        else if(singleLine_content.includes("static")){
            return console.log("This is the Static Handler",singleLine_content)
        }
        else{
            return console.log("This is the Rest of the Members",singleLine_content)
        }
    }

    const codeReplacer = (singleLine_content) => {
        if(singleLine_content.startsWith("push")){
            pushHandler(singleLine_content);
        }
        else if(singleLine_content.startsWith("pop")){
            popHandler(singleLine_content);
        }
    }

    content.map((item) => 
        codeReplacer(item)
    );

    return (
        <div>
            Yo Niggas
        </div>
    );
}

export default Codewriter;
